import React from 'react';
import logo from './logo.svg';
import './App.css';

import Layout from './containers/layout/layout';
import Builder from './containers/builder/builder';
import Checkout from './containers/checkout/checkout';

function App() {
  return (
    <div className="App">
      <Layout>
        <Builder/>
        <Checkout/>
      </Layout>
    </div>
  );
}

export default App;
